function navigationLoaderComplete(e:Event):void {
	var data:String = loader.data;
	for (i = 0; i < data.length; i++) {
		var char = data.charAt(i);
		if (char == '0') {
			hideNavigationList(i + 1);
		}
	}
	
	loader2 = new URLLoader();
	loader2.load(new URLRequest('data/title.config'));
	loader2.addEventListener(Event.COMPLETE, titleLoaderComplete);
}

function titleLoaderComplete(e:Event):void {
    var data:Array = loader2.data.split('\n');

	N1Btn.Title1.mouseEnabled = false;
	N2Btn.Title2.mouseEnabled = false;
	N3Btn.Title3.mouseEnabled = false;
	N4Btn.Title4.mouseEnabled = false;
	N5Btn.Title5.mouseEnabled = false;
	N6Btn.Title6.mouseEnabled = false;

	N1Btn.Title1.text = data[0];
	N2Btn.Title2.text = data[1];
	N3Btn.Title3.text = data[2];
	N4Btn.Title4.text = data[3];
	N5Btn.Title5.text = data[4];
	N6Btn.Title6.text = data[5];

	play();
}

function navigationLoaderError(e:Event):void {
	var txt:TextField = new TextField();

	txt.x = 0;
	txt.y = 450;
	txt.width = 1280;
	txt.textColor = 0xffffff;
	txt.text = 'No data';
	txt.autoSize = 'center';

	addChild(txt);
}

function ruleLoaderComplete(e:Event):void {
	var data:String = loader.data;
	Rule.text = data;
}

function mcLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var question:String = data[0] + '\n' + data[1];
	Question.text = question;
	AnswerA.text = 'A.　' + data[2];
	AnswerB.text = 'B.　' + data[3];
	AnswerC.text = 'C.　' + data[4];
	AnswerD.text = 'D.　' + data[5];
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerA);
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerB);
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerC);
	AnswerBtnA1.removeEventListener(MouseEvent.CLICK, highlightAnswerD);
	if (data[6] == '1') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerA);
	} else if (data[6] == '2') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerB);
	} else if (data[6] == '3') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerC);
	} else if (data[6] == '4') {
		AnswerBtnA1.addEventListener(MouseEvent.CLICK, highlightAnswerD);
	}
}

