function sqLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var question:String = data[0] + '\n' + data[1];
	Question.text = question;
	B1.text = data[2];
	AnswerBtnB1.removeEventListener(MouseEvent.CLICK, showAnswer);
	AnswerBtnB1.addEventListener(MouseEvent.CLICK, showAnswer);
}

function showAnswer(e:Event):void {
