function musicLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var position:String = '';
	if (data[6] == '1') {
		position = '';
	} else if (data[6] == '2') {
		position = 'OP';
	} else if (data[6] == '3') {
		position = 'ED';
	} else if (data[6] == '4') {
		position = '挿入歌';
	}
	var result:String = '♪ ' + data[1] + '　「' + data[0] + '」' + position;
	musicAnswer.text = result;
}

function tfLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var question:String = data[0] + '\n' + data[1];
	Question.text = question;
	AnswerBtn.removeEventListener(MouseEvent.CLICK, revealTrue);
	AnswerBtn.removeEventListener(MouseEvent.CLICK, revealFalse);
	if (data[6] == '1') {
		AnswerBtn.addEventListener(MouseEvent.CLICK, revealTrue);
	} else if (data[6] == '2') {
		AnswerBtn.addEventListener(MouseEvent.CLICK, revealFalse);
	}
}

function picLoaderComplete(e:Event):void {
	var data:Array = loader.data.split('\n');
	var answer:String = data[0];
	var format:TextFormat = new TextFormat();
	format.size = data[6];
	Answer.text = answer;
	Answer.setTextFormat(format);
}

function revealTrue(e:Event):void {
	trueSymbol.visible = true;
}

function revealFalse(e:Event):void {
	falseSymbol.visible = true;
}

function loaderIOErrorHandler(e:Event):void {
	nextFrame();
}

function hideMusicList(i):void {
	this['List' + i].visible = false;
	this['E' + i + 'Icon'].visible = false;
	this['E' + i + 'Title'].visible = false;
	this['E' + i + 'PlayBtn'].visible = false;
	this['E' + i + 'AnswerBtn'].visible = false;
}

function hideNavigationList(i):void {
	this['N' + i + 'Btn'].visible = false;
}

function checkMusicExist(start, end):void {
	for (var i = start; i <= end; i++) {
		url = new URLRequest('data/music/' + i + '.config');
		
		loader = new URLLoader();
		loader.load(url);

		if (i == start) {
			loader.addEventListener(IOErrorEvent.IO_ERROR, function(e):void {
				play();
			});
		} else {
			loader.addEventListener(IOErrorEvent.IO_ERROR, function(e):void {
				var i = e.text.slice(e.text.lastIndexOf('music/') + 6, e.text.lastIndexOf('.config'));
				hideMusicList(i);
			});
		}
	}
}

function playWrapper(e:Event):void {
	play();
}

